PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `SequelizeMeta` (`name` VARCHAR(255) NOT NULL UNIQUE PRIMARY KEY);
CREATE TABLE `Users` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `email` VARCHAR(255) NOT NULL UNIQUE, `phone` VARCHAR(255), `password` VARCHAR(255) NOT NULL, `role` TEXT NOT NULL DEFAULT 'customer', `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `Admins` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `user_id` INTEGER NOT NULL REFERENCES `Users` (`id`), `permissions` TEXT, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `Customers` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `user_id` INTEGER NOT NULL REFERENCES `Users` (`id`), `address` VARCHAR(255) NOT NULL, `country_name` VARCHAR(255) NOT NULL, `country_code` CHAR(3) DEFAULT 'VN', `first_name` VARCHAR(255) NOT NULL, `middle_name` VARCHAR(255) NOT NULL, `last_name` VARCHAR(255) NOT NULL, `date_of_birth` DATETIME NOT NULL, `gender` TEXT, `promo_code` INTEGER, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `Airlines` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `name` VARCHAR(255) NOT NULL, `country_code` CHAR(3), `motto` TEXT, `establish_date` DATETIME, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `Airplanes` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `model` VARCHAR(255) NOT NULL, `manufacturer` VARCHAR(255), `seat_count` INTEGER NOT NULL, `airline_id` INTEGER REFERENCES `Airlines` (`id`), `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `Flights` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `airplane_id` INTEGER REFERENCES `Airplanes` (`id`), `flight_number` VARCHAR(255) NOT NULL UNIQUE, `origin` VARCHAR(255) NOT NULL, `destination` VARCHAR(255) NOT NULL, `departure_time` DATETIME NOT NULL, `arrival_time` DATETIME NOT NULL, `duration` TIME NOT NULL, `status` TEXT NOT NULL DEFAULT 'Scheduled', `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `Seats` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `flight_id` INTEGER REFERENCES `Flights` (`id`), `seat_type` TEXT NOT NULL DEFAULT 'Economy', `price` DECIMAL(10,2) NOT NULL, `seat_number` VARCHAR(255), `is_available` TINYINT(1) NOT NULL DEFAULT 1, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `Bookings` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `customer_id` INTEGER REFERENCES `Customers` (`id`), `flight_id` INTEGER REFERENCES `Flights` (`id`), `seat_id` INTEGER REFERENCES `Seats` (`id`), `departure_time` DATETIME, `return_time` DATETIME, `booking_date` DATETIME NOT NULL, `status` TEXT NOT NULL DEFAULT 'Pending', `passengers` INTEGER NOT NULL DEFAULT 1, `class` TEXT NOT NULL DEFAULT 'Economy', `total_price` DECIMAL(10,2) NOT NULL, `payment_status` TEXT NOT NULL DEFAULT 'Pending', `payment_method` TEXT NOT NULL, `booking_reference` VARCHAR(255) NOT NULL UNIQUE, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `Posts` (`id` INTEGER PRIMARY KEY AUTOINCREMENT, `title` VARCHAR(255) NOT NULL, `content` TEXT, `post_type` TEXT NOT NULL, `admin_id` INTEGER NOT NULL REFERENCES `Admins` (`id`), `start_date` DATETIME, `end_date` DATETIME, `is_published` TINYINT(1) NOT NULL DEFAULT 0, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
COMMIT;
