INSERT INTO Posts VALUES(1,'Chào mừng đến với QAirline','Chào mừng đến với hệ thống đặt vé máy bay mới của chúng tôi! Chúng tôi rất vui mừng mang đến cho bạn trải nghiệm đặt vé tốt nhất với giá cả cạnh tranh và dịch vụ xuất sắc.','announcement',1,'2025-06-04 03:37:40.381 +00:00',NULL,1,'2025-06-04 03:37:40.381 +00:00','2025-06-04 03:37:40.381 +00:00');
INSERT INTO Posts VALUES(2,'Khuyến mãi mùa hè','Đặt vé máy bay mùa hè ngay bây giờ và nhận giảm giá 20%! Áp dụng cho tất cả các chuyến bay nội địa từ tháng 6 đến tháng 8 năm 2024. Sử dụng mã SUMMER2024 khi thanh toán.','promotion',1,'2024-06-01 00:00:00.000 +00:00','2024-08-31 00:00:00.000 +00:00',1,'2025-06-04 03:37:40.381 +00:00','2025-06-04 03:37:40.381 +00:00');
INSERT INTO Posts VALUES(3,'Thêm tuyến bay mới','Chúng tôi vui mừng thông báo về việc mở thêm các tuyến bay mới kết nối các thành phố lớn tại Việt Nam. Hãy khám phá mạng lưới mở rộng của chúng tôi và lên kế hoạch cho chuyến đi tiếp theo!','news',1,'2025-06-04 03:37:40.381 +00:00',NULL,1,'2025-06-04 03:37:40.381 +00:00','2025-06-04 03:37:40.381 +00:00');
INSERT INTO Posts VALUES(4,'Về QAirline','QAirline là hãng hàng không hàng đầu tại Việt Nam, cam kết cung cấp dịch vụ hàng không an toàn, thoải mái và giá cả phải chăng cho khách hàng.','introduction',1,'2025-06-04 03:37:40.381 +00:00',NULL,1,'2025-06-04 03:37:40.381 +00:00','2025-06-04 03:37:40.381 +00:00');
INSERT INTO Posts VALUES(5,'Ưu đãi đặc biệt mùa đông','Hãy chuẩn bị cho mùa đông với những ưu đãi đặc biệt của chúng tôi! Đặt vé cho tháng 12 và tháng 1 để tận hưởng những ưu đãi độc quyền.','promotion',1,'2024-12-01 00:00:00.000 +00:00','2025-01-31 00:00:00.000 +00:00',1,'2025-06-04 03:37:40.381 +00:00','2025-06-04 03:59:59.069 +00:00');
